import { Link } from "react-router-dom";

const Navbar = ({loggedIn}) => {
    console.log(loggedIn)
    return (
        <div>
            {loggedIn ? (
                <p>logged in</p>
            ) : (
                <p> not logged in.</p>
            )}
        </div>
    )
}
export default Navbar
